import ToDoListItem from '../../atoms/ToDoListItem/ToDoListItem';
import { StyledList } from './styled'

const ToDoList = (props) => {
  const { list } = props;
  return (
    <>
      <StyledList>
        {list.map((listItem) => (
          <ToDoListItem>{listItem.text}</ToDoListItem>
        ))}
      </StyledList>
    </>
  );
};

export default ToDoList;
